import React, { useEffect, useState, useContext } from 'react';
import { UserContext } from '../../App';

const Profile = () => {
    const [mypics, setPics] = useState([]);
    const { state, dispatch } = useContext(UserContext);
    const [image, setImage] = useState("");

    useEffect(() => {
        fetch('/mypost', {
            headers: {
                "Authorization": "Bearer " + localStorage.getItem("jwt"),
            },
        })
            .then((res) => res.json())
            .then((result) => {
                setPics(result.mypost);
            })
            .catch((err) => {
                console.error("Error fetching posts:", err);
            });
    }, []);

    useEffect(() => {
        if (image) {
            const data = new FormData();
            data.append("file", image);
            data.append("upload_preset", "insta-clone");
            data.append("cloud_name", "cnq");

            fetch("https://api.cloudinary.com/v1_1/dqkmnrjdr/image/upload", {
                method: "POST",
                body: data,
            })
                .then((res) => res.json())
                .then((data) => {
                    fetch('/updatepic', {
                        method: "PUT",
                        headers: {
                            "Content-Type": "application/json",
                            "Authorization": "Bearer " + localStorage.getItem("jwt"),
                        },
                        body: JSON.stringify({
                            pic: data.url,
                        }),
                    })
                        .then((res) => res.json())
                        .then((result) => {
                            localStorage.setItem("user", JSON.stringify({ ...state, pic: result.pic }));
                            dispatch({ type: "UPDATEPIC", payload: result.pic });
                        })
                        .catch((err) => console.error("Error updating profile pic:", err));
                })
                .catch((err) => console.error("Error uploading image:", err));
        }
    }, [image, state, dispatch]);

    const updatePhoto = (file) => {
        setImage(file);
    };

    return (
        <div style={{ maxWidth: "550px", margin: "0px auto" }}>
            <div
                style={{
                    margin: "18px 0px",
                    borderBottom: "1px solid grey",
                }}
            >
                <div
                    style={{
                        display: "flex",
                        justifyContent: "space-around",
                    }}
                >
                    <div>
                        <img
                            style={{
                                width: "160px",
                                height: "160px",
                                borderRadius: "80px",
                            }}
                            src={state?.pic || "https://via.placeholder.com/160"}
                            alt="profile"
                        />
                    </div>
                    <div>
                        <h4>{state?.name || "loading"}</h4>
                        <h5>{state?.email || "loading"}</h5>
                        <div
                            style={{
                                display: "flex",
                                justifyContent: "space-between",
                                width: "108%",
                            }}
                        >
                            <h6>{mypics.length} posts</h6>
                            <h6>{state?.followers?.length || "0"} followers</h6>
                            <h6>{state?.following?.length || "0"} following</h6>
                        </div>
                    </div>
                </div>

                <div className="file-field input-field" style={{ margin: "10px" }}>
                    <div className="btn #64b5f6 blue darken-1">
                        <span>Update pic</span>
                        <input type="file" onChange={(e) => updatePhoto(e.target.files[0])} />
                    </div>
                    <div className="file-path-wrapper">
                        <input className="file-path validate" type="text" />
                    </div>
                </div>
            </div>
            <div className="gallery">
                {mypics.map((item) => (
                    <img key={item._id} className="item" src={item.photo} alt={item.title} />
                ))}
            </div>
        </div>
    );
};

export default Profile;
